VALUES ('4000417651303', 'Schokowürfel', 'Mischung gefüllten Vollmilchscho - A aus koladen. Vollmilchschokolade gefüllt mit einer Sahnecreme (36%), kakaohaltigen Mürbe gebäck - (2,5% ) und Schokoladenstückchen (2,5%). Gefüllte Vollmilchschokolade mit Scho koladencreme (34 %) und Keks-Crisp (4% ). Gefüllte Vollmilchschokolade mit einer ganzen Haselnuss (10%) in Nussnugatcreme (30%) mit Haselnuss-Stückchen (2%) und Reisflakes (1%). Gefüllte Alpen-Vollmilchschokolade mit einer aufgeschlagenen Kakaocreme (43%). Gefüllte Vollmilchschokolade mit Magermilch - joghurt-Creme (46%). Zutaten: Zucker, Palmfett, Kakaobutter, Vollmilchpulver, Kakaomasse, Milch - zucker, Magermilchpulver, Magermilchjoghurtpulver, Butterreinfett, Haselnüsse, Haselnussmasse, Sah - nepulver, magerer Kakao, Weizenmehl, Emulgator: Lecithine (Soja), Haselnüsse (gehackt), Reis, Wei - zenmalz, Bourbon Vanille Extrakt, Weizenstärke, Salz, Glukosesirup, Maltodextrin, Überzugsmittel: Gummi Arabicum, Gerstenmalzextrakt. Kann Spuren von Erd - nüssen, anderen Schalenfrüchten und Ei enthalten.', 'https://static.openfoodfacts.org/images/products/400/041/765/1303/front_de.11.400.jpg', '39', '22', '49', '48', '', '6.6', '0.24', '0.094488188976378', '', '0');

